import { useEffect } from 'react';
import { HeaderModel } from '../model/header';
import { Heading, Text, Input, InputGroup, InputLeftElement, FormControl, FormLabel, Box, Stack } from '@chakra-ui/react';
import { PhoneIcon } from "@chakra-ui/icons";
import './headerComponent.css'
function Header() {
    useEffect(() => {

        const getHeader = async() => {
          let headerModel = new HeaderModel()
          let header = await headerModel.getHeader()
          console.log(header[0])
        }

        getHeader()
      }, [])


    return (
        <div>
            {/* <Text>First Name</Text>
            <Text>Last Name</Text>
            <Text>Catchy Headline</Text>
            <Text>Location City, State</Text>
            <Text>Phone Number</Text> */}

            <Box border="1px solid #E2E8F0" borderRadius="md" p={4} position="relative">
                <Box position="absolute" top="0" right="0" mr={4} mt={4} color="gray.500" fontSize="sm">
                    Header
                </Box>
                {/* <FormControl> */}
                    <Stack>
                        <Box>
                            <FormLabel whiteSpace="nowrap">First Name</FormLabel>
                            <Input placeholder='First Name'></Input>
                        </Box>


                        <Box>
                            <FormLabel whiteSpace="nowrap">Last Name</FormLabel>
                            <Input placeholder='Last Name'></Input>
                        </Box>

                        <Box>
                            <FormLabel whiteSpace="nowrap">Catchy Headline</FormLabel>
                            <Input placeholder='Catchy Headline'></Input>
                        </Box>

                        <Box>
                            <FormLabel whiteSpace="nowrap">City, State</FormLabel>
                            <Input placeholder='City, State'></Input>

                        </Box>

                        <Box>
                            <FormLabel whiteSpace="nowrap">Phone Number</FormLabel>
                            <InputGroup>
                                <InputLeftElement pointerEvents='none'>
                                    <PhoneIcon color='gray.300' />
                                </InputLeftElement>
                                <Input type='tel' placeholder='Phone number' />
                            </InputGroup>  
                        </Box>
                    </Stack>


                {/* </FormControl> */}
            </Box>

        </div>
    )
}

export default Header;
